import React, { Component, useContext } from "react";
import axios from "axios";
import { observer } from "mobx-react-lite";
import { birthContext } from "../context/birth";
import Link from "next/link";

const topnavbar = observer(({ shows }) => {
  const birthInfo = useContext(birthContext);
  return (
    <div>
      <button type="button" class="btn btn-primary">
        Primary
      </button>
      {birthInfo.birth_total}
      <h1>Batman TV Shows</h1>
      {shows}
    </div>
  );
});

topnavbar.getInitialProps = async () => {
  const res = await axios.get("http://api.tvmaze.com/search/shows?q=batman");
  const data = res.data;
  console.log(`Show data fetched. Count: ${data.length}`);

  return {
    shows: data.map((entry) => entry.show),
  };
};

export default topnavbar;
